import {
  Button,
  Card,
  Form,
  FormLayout,
  Layout,
  Page,
  Stack,
  TextField,
  TextStyle,
  EmptyState
} from '@shopify/polaris';

function Header() {
  return (
    <nav>
      <NavLink exact activeClassName="active" to="/">
        Home
      </NavLink>
      <NavLink activeClassName="active" to="/users">
        Users
      </NavLink>
      <NavLink activeClassName="active" to="/contact">
        Contact
      </NavLink>
    </nav>
  );
}

const Index = () => (
  
  <Page>

    <Layout>
      <Card>
    <EmptyState
        action={{
          content: 'Select products',
          onAction: () => console.log('clicked'),
        }}
        
      >
      </EmptyState>
      </Card>
<div>
       <Card>
    <EmptyState
        action={{
          content: 'Select products',
          onAction: () => console.log('clicked'),
        }}
        
      >
      </EmptyState>
      </Card>
      </div>
    </Layout>
  </Page>
  
);

export default Index;
